     我

      苹果手机

     被盗，手机里绑定很多理财通账户，苹果公司已经封锁我账户了，让我四天内注意邮箱，但是你们腾讯的邮箱被盗了，密码也被修改了，请问我怎么找回我的邮箱？你们的人工我打了23个小时的电话，语音一直重复说客服全忙，请问你们的生意是有多忙？请马上解决！


     各位新闻媒体们我要说的是如果这么大的公司都不能做到人工服务随时接听，不能解决客户的问题，请问他们的支付平台怎么能让百姓踏实？我同时打了招商银行和支付宝电话，都很好地被解决了，为什么就是腾讯23小时都在繁忙？请各位媒体帮忙扩散，好让腾讯引起重视并进行有效的处理，相信小偷已经通过邮箱破解了我的密码，相信我的财产安全也会受到影响，请各位帮忙联系相关部门让平民百姓有更好的保障，谢谢了！

