      #抚顺交宣#


      #抚顺身边事#

     【我在马路边捡到一部手机  把它交到警察叔叔手里面】

     3月15日晚高峰，顺城大队新华中队的民警在顺城路中段执勤，此时正是附近十五中学学生放学时段，接孩子放学的家长和车辆颇多，交警正忙着指挥疏导车辆时，有四名学生手里拿着一部苹果手机急匆匆地像交警走过来，经民警询问，四名学生分别是刚刚放学的十五中学8年1班和8年4班的学生陈相印、刘忠升、岳廷旭、张子博，他们在放学回家的路上捡到一部iPhone手机，正巧看见当时晚高峰执勤民警顺城交警大队新华中队长黄文秀就将捡到的手机交给警察叔叔，通过警察叔叔找到失主！当时正在执勤的民警黄文秀接过手机后并查看手机但不巧手机因电量不足而关机，本想等晚高峰结束以后带着四名孩子寻找手机失主，但四名孩子做完好事没有留下联系方式已经离开！黄文秀回到大队以后，大队通过多种方式和多方寻找，终于联系到失主，因大队晚上还有违法行为整治行动，只能随身携带手机等待失主到执勤点取走，晚上20时左右，失主赶到顺城大队的执勤点找到民警黄文秀，民警立即将手机交还给失主，失主对顺城大队民警表示十分感谢并且很想当面谢谢拾到手机的四名孩子，但是孩子已经放学回家联系不到。拾金不昧，高尚美德，是中华民族传统美德，在这里，给我们四名十五中的好孩子和执勤民警黄文秀点个大大的赞，希望这种美德发扬光大！

      @辽宁交警


      @抚顺宣传


      @平安抚顺


      @抚顺同城会


